        ( 
			BANK_ID ,BRANCH_NAME ,BRANCH_CODE1 ,BRANCH_CODE2 ,BRANCH_STATE ,BRANCH_DISTRICT ,BRANCH_ADDRESS ,
			BRANCH_PHONE ,BRANCH_EMAIL ,BRANCH_COUNTRY ,IS_ACTIVE ,PAYMENT_TYPE_ID
        )
